Insert into MSC_ENGINE_COMMUNICATION (EXECUTION_ID,PLAN_ID,PROFILE_ID,PNAME,PTYPE,VALUE_FLOAT,VALUE_DATE,VALUE_STRING) values (1,20001,6731,'QueryArrayUpdateData','query',null,null,'MERGE INTO MSC_TST_DATA_61559_DYD TRG USING (SELECT s.PRD_LVL_MEMBER_ID    AS PRD_LVL_MEMBER_ID ,s.ORG_LVL_MEMBER_ID    AS ORG_LVL_MEMBER_ID ,s.CUS_LVL_MEMBER_ID    AS CUS_LVL_MEMBER_ID ,s.DCS_LVL_MEMBER_ID    AS DCS_LVL_MEMBER_ID ,s.PLN_LVL_MEMBER_ID    AS PLN_LVL_MEMBER_ID ,s.TIM_LVL_MEMBER_ID    AS TIM_LVL_MEMBER_ID ,m.measure_1694  AS GLOB_PROP ,SUM(m.measure_1694) OVER (PARTITION BY s.PRD_LVL_MEMBER_ID, s.ORG_LVL_MEMBER_ID, s.TIM_LVL_MEMBER_ID) AS SUM_GLOB_PROP ,COUNT(1)   OVER (PARTITION BY s.PRD_LVL_MEMBER_ID, s.ORG_LVL_MEMBER_ID, s.TIM_LVL_MEMBER_ID) AS ROW_COUNT ,?   AS OUT_FORECAST ,?  AS OUT_FORECAST_OUTLIER ,?  AS OUT_REGIME_CHANGE from        MSC_TST_DATA_61560_DYD m inner join  MSC_TST_DATA_61559_DYD s   on m.PRD_LVL_MEMBER_ID   =  s.PRD_LVL_MEMBER_ID  AND m.ORG_LVL_MEMBER_ID   =  s.ORG_LVL_MEMBER_ID  AND m.CUS_LVL_MEMBER_ID   =  s.CUS_LVL_MEMBER_ID  AND m.PLN_LVL_MEMBER_ID   =  s.PLN_LVL_MEMBER_ID  AND s.PRD_LVL_MEMBER_ID   =  ?  AND s.ORG_LVL_MEMBER_ID   =  ?  AND s.TIM_LVL_MEMBER_ID   =  (select TIM_51_ID from MSC_DIMENSION_TIM_DYD where tim_level_id=51 and FROM_DATE = ?) ) SRC ON (SRC.PRD_LVL_MEMBER_ID = TRG.PRD_LVL_MEMBER_ID AND SRC.ORG_LVL_MEMBER_ID = TRG.ORG_LVL_MEMBER_ID AND SRC.CUS_LVL_MEMBER_ID = TRG.CUS_LVL_MEMBER_ID AND SRC.DCS_LVL_MEMBER_ID = TRG.DCS_LVL_MEMBER_ID AND SRC.PLN_LVL_MEMBER_ID = TRG.PLN_LVL_MEMBER_ID AND SRC.TIM_LVL_MEMBER_ID = TRG.TIM_LVL_MEMBER_ID) WHEN MATCHED THEN UPDATE SET TRG.LAST_UPDATE_DATE = SYSTIMESTAMP ,TRG.measure_1646 = (SRC.OUT_FORECAST * (CASE WHEN NVL(SRC.SUM_GLOB_PROP, 0) > 0 THEN SRC.GLOB_PROP / SRC.SUM_GLOB_PROP ELSE 1 / SRC.ROW_COUNT END)) ,TRG.measure_1791 = SRC.OUT_FORECAST_OUTLIER ,TRG.measure_1908 = SRC.OUT_REGIME_CHANGE ');
