Insert into MSC_ENGINE_COMMUNICATION (EXECUTION_ID,PLAN_ID,PROFILE_ID,PNAME,PTYPE,VALUE_FLOAT,VALUE_DATE,VALUE_STRING) values (1,20001,6731,'QueryCausalFactorsConfig','query',null,null,'SELECT cfb.CAUSAL_FACTOR_ID,UPPER(CAUSAL_FACTOR_DISP_NAME), DECODE(LOWER(CAUSAL_TYPE_NAME),''seasonality'',''global'',''holiday'',''global'',''baseline volume'',''global'',''trend'',''global'',''price'',''price'',''local''), SHORT_METHODS,LONG_METHODS,MULTI_METHOD_GR1,MULTI_METHOD_GR2,NON_SEASONAL,FILL_MISSING_VALUES,SHAPE_DEF, 0,0,'' '','' '',SCALE_UNEVEN_PERIODS,TIME_RELATED FROM MSC_PROFILE_CAUSAL_FACTORS_B cfb, MSC_PROFILE_CAUSAL_FACTORS_TL cftl, MSC_CAUSAL_FACTORS_TYPES_TL cfttl  WHERE cfb.CAUSAL_FACTOR_ID = cftl.CAUSAL_FACTOR_ID and cfb.PROFILE_ID = cftl.PROFILE_ID and  cfb.CAUSAL_TYPE_ID = cfttl.CAUSAL_TYPE_ID and cftl.LANGUAGE = cfttl.LANGUAGE and  cftl.LANGUAGE = ''US'' and cfb.PROFILE_ID = ? and ( SHORT_METHODS = 1 OR  LONG_METHODS = 1 OR MULTI_METHOD_GR1 = 1 OR MULTI_METHOD_GR2 = 1 OR NON_SEASONAL = 1)  order by cfb.causal_factor_id ');
